package ra.Model.Entity;public class Star {    private int starID;    private int userID;    private int orderID;    private String fullName;    private int productID;    private String productName;    private int numberStar;    private boolean starStatus;    public Star() {    }    public Star(int starID, int userID, int orderID, String fullName, int productID, String productName, int numberStar, boolean starStatus) {        this.starID = starID;        this.userID = userID;        this.orderID = orderID;        this.fullName = fullName;        this.productID = productID;        this.productName = productName;        this.numberStar = numberStar;        this.starStatus = starStatus;    }    public int getStarID() {        return starID;    }    public void setStarID(int starID) {        this.starID = starID;    }    public int getUserID() {        return userID;    }    public void setUserID(int userID) {        this.userID = userID;    }    public int getOrderID() {        return orderID;    }    public void setOrderID(int orderID) {        this.orderID = orderID;    }    public String getFullName() {        return fullName;    }    public void setFullName(String fullName) {        this.fullName = fullName;    }    public int getProductID() {        return productID;    }    public void setProductID(int productID) {        this.productID = productID;    }    public String getProductName() {        return productName;    }    public void setProductName(String productName) {        this.productName = productName;    }    public int getNumberStar() {        return numberStar;    }    public void setNumberStar(int numberStar) {        this.numberStar = numberStar;    }    public boolean isStarStatus() {        return starStatus;    }    public void setStarStatus(boolean starStatus) {        this.starStatus = starStatus;    }}